INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 106001, 7001, "キャル", 7, "2015/12/17 15:00:00", "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 105901, 7002, "コッコロ", 7, "2015/12/17 15:00:00", "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 105801, 7003, "ペコリーヌ", 7, "2015/12/17 15:00:00", "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 105801, 10001, "ペコリーヌ", 10, "2015/12/17 15:00:00", "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 106001, 10002, "キャル", 10, "2015/12/17 15:00:00", "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 105901, 10003, "コッコロ", 10, "2015/12/17 15:00:00", "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (2, 0.0, 0, 2104010, -363.0, 1, "2030/12/17 14:59:59", 106401, 10004, "シェフィ", 10, "2015/12/17 15:00:00", "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -416.5, 1, "2030/12/17 14:59:59", 105801, 12001, "ペコリーヌ", 12, "2015/12/17 15:00:00", "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 106001, 13001, "キャル", 13, "2015/12/17 15:00:00", "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 105901, 13002, "コッコロ", 13, "2015/12/17 15:00:00", "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (2, 0.0, 0, 2104010, -363.0, 1, "2030/12/17 14:59:59", 106401, 13003, "シェフィ", 13, "2015/12/17 15:00:00", "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 105801, 13004, "ペコリーヌ", 13, "2015/12/17 15:00:00", "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 105901, 14001, "コッコロ", 14, "2015/12/17 15:00:00", "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (2, 0.0, 0, 2104010, -363.0, 1, "2030/12/17 14:59:59", 106401, 14002, "シェフィ", 14, "2015/12/17 15:00:00", "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 105801, 14003, "ペコリーヌ", 14, "2015/12/17 15:00:00", "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 106001, 14004, "キャル", 14, "2015/12/17 15:00:00", "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -470.0, 1, "2030/12/17 14:59:59", 105901, 15001, "コッコロ", 15, "2015/12/17 15:00:00", "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (2, 0.0, 0, 2104010, -363.0, 1, "2030/12/17 14:59:59", 106401, 16001, "シェフィ", 16, "2015/12/17 15:00:00", "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 105801, 16002, "ペコリーヌ", 16, "2015/12/17 15:00:00", "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 106001, 16003, "キャル", 16, "2015/12/17 15:00:00", "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 105901, 16004, "コッコロ", 16, "2015/12/17 15:00:00", "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 105901, 17002, "コッコロ", 17, "2015/12/17 15:00:00", " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 106001, 17004, "キャル", 25, "2015/12/17 15:00:00", "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 105901, 17005, "コッコロ", 25, "2015/12/17 15:00:00", "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (2, 0.0, 0, 2104010, -363.0, 1, "2030/12/17 14:59:59", 106401, 17006, "シェフィ", 25, "2015/12/17 15:00:00", "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 105801, 17007, "ペコリーヌ", 25, "2015/12/17 15:00:00", "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 190801, 18001, "カリン", 18, "2015/12/17 15:00:00", "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 190801, 18002, "カリン", 18, "2015/12/17 15:00:00", "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 0.0, 2);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -470.0, 1, "2030/12/17 14:59:59", 190801, 19001, "カリン", 19, "2015/12/17 15:00:00", "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 0.0, 3);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -470.0, 1, "2030/12/17 14:59:59", 190801, 19002, "カリン", 19, "2015/12/17 15:00:00", "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 0.0, 4);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -470.0, 1, "2030/12/17 14:59:59", 190801, 20001, "カリン", 20, "2015/12/17 15:00:00", "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 0.0, 5);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -470.0, 1, "2030/12/17 14:59:59", 190801, 20002, "カリン", 20, "2015/12/17 15:00:00", "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 0.0, 6);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 106001, 21001, "キャル", 21, "2015/12/17 15:00:00", "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 105901, 21002, "コッコロ", 21, "2015/12/17 15:00:00", "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (2, 0.0, 0, 2104010, -363.0, 1, "2030/12/17 14:59:59", 106401, 21003, "シェフィ", 21, "2015/12/17 15:00:00", "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 105801, 21004, "ペコリーヌ", 21, "2015/12/17 15:00:00", "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -430.0, 1, "2030/12/17 14:59:59", 190801, 22001, "カリン", 22, "2015/12/17 15:00:00", "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -430.0, 1, "2030/12/17 14:59:59", 190801, 22002, "カリン", 22, "2015/12/17 15:00:00", "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 0.0, 2);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -430.0, 1, "2030/12/17 14:59:59", 190801, 23001, "カリン", 23, "2015/12/17 15:00:00", "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 0.0, 3);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -430.0, 1, "2030/12/17 14:59:59", 190801, 23002, "カリン", 23, "2015/12/17 15:00:00", "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 0.0, 4);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 4.08, 10011, 0, -385.0, 2, "2030/12/17 14:59:59", 109001, 24001, "エリコ（バレンタイン）", 24, "2019/01/31 12:00:00", "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 8.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 5.0, 10011, 0, -385.0, 2, "2030/12/17 14:59:59", 109001, 24002, "エリコ（バレンタイン）", 24, "2019/01/31 12:00:00", "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 8.0, 2);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 10.11, 10011, 0, -385.0, 2, "2030/12/17 14:59:59", 109001, 24003, "エリコ（バレンタイン）", 24, "2019/01/31 12:00:00", "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 8.0, 3);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 4.0, 10011, 0, -385.0, 2, "2030/12/17 14:59:59", 109001, 24004, "エリコ（バレンタイン）", 24, "2019/01/31 12:00:00", "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 8.0, 4);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 6.0, 10011, 0, -385.0, 2, "2030/12/17 14:59:59", 109001, 24005, "エリコ（バレンタイン）", 24, "2019/01/31 12:00:00", "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 8.0, 5);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 10011, 0, 0.0, 1, "2030/12/17 14:59:59", 109002, 24006, "エリコ（バレンタイン）", 24, "2019/01/31 12:00:00", "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 0.0, 6);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 10011, 0, 0.0, 1, "2030/12/17 14:59:59", 109002, 24007, "エリコ（バレンタイン）", 24, "2019/01/31 12:00:00", "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 0.0, 7);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 10011, 0, 0.0, 1, "2030/12/17 14:59:59", 109002, 24008, "エリコ（バレンタイン）", 24, "2019/01/31 12:00:00", "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 0.0, 8);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 10011, 0, 0.0, 1, "2030/12/17 14:59:59", 109002, 24009, "エリコ（バレンタイン）", 24, "2019/01/31 12:00:00", "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 0.0, 9);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 10011, 0, 0.0, 1, "2030/12/17 14:59:59", 109002, 24010, "エリコ（バレンタイン）", 24, "2019/01/31 12:00:00", "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 0.0, 10);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 2.12, 10011, 0, -385.0, 2, "2030/12/17 14:59:59", 109101, 24011, "シズル（バレンタイン）", 24, "2019/01/31 12:00:00", "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 8.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (5, 4.19, 10011, 0, -385.0, 2, "2030/12/17 14:59:59", 109101, 24012, "シズル（バレンタイン）", 24, "2019/01/31 12:00:00", "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 8.0, 2);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (2, 2.3, 10011, 0, -385.0, 4, "2030/12/17 14:59:59", 109101, 24013, "シズル（バレンタイン）", 24, "2019/01/31 12:00:00", "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 8.0, 3);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 10011, 0, 0.0, 1, "2030/12/17 14:59:59", 109102, 24014, "シズル（バレンタイン）", 24, "2019/01/31 12:00:00", "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 0.0, 4);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (5, 5.23, 10011, 0, -385.0, 2, "2030/12/17 14:59:59", 109101, 24015, "シズル（バレンタイン）", 24, "2019/01/31 12:00:00", "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 8.0, 5);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 10011, 0, 0.0, 1, "2030/12/17 14:59:59", 109102, 24016, "シズル（バレンタイン）", 24, "2019/01/31 12:00:00", "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 0.0, 6);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 5.01, 10011, 0, -385.0, 2, "2030/12/17 14:59:59", 109101, 24017, "シズル（バレンタイン）", 24, "2019/01/31 12:00:00", "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 8.0, 7);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 10011, 0, 0.0, 1, "2030/12/17 14:59:59", 109102, 24018, "シズル（バレンタイン）", 24, "2019/01/31 12:00:00", "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 0.0, 8);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 10011, 0, 0.0, 1, "2030/12/17 14:59:59", 109102, 24019, "シズル（バレンタイン）", 24, "2019/01/31 12:00:00", "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 0.0, 9);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 10011, 0, 0.0, 1, "2030/12/17 14:59:59", 109102, 24020, "シズル（バレンタイン）", 24, "2019/01/31 12:00:00", "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 0.0, 10);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (2, 0.0, 0, 2104010, -363.0, 1, "2030/12/17 14:59:59", 106401, 26001, "シェフィ", 26, "2015/12/17 15:00:00", "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 105801, 26002, "ペコリーヌ", 26, "2015/12/17 15:00:00", "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 106001, 26003, "キャル", 26, "2015/12/17 15:00:00", "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 105901, 26004, "コッコロ", 26, "2015/12/17 15:00:00", "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (2, 0.0, 0, 2104010, -363.0, 1, "2030/12/17 14:59:59", 106401, 27001, "シェフィ", 27, "2015/12/17 15:00:00", "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 105801, 27002, "ペコリーヌ", 27, "2015/12/17 15:00:00", "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 106001, 27003, "キャル", 27, "2015/12/17 15:00:00", "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 105901, 27004, "コッコロ", 27, "2015/12/17 15:00:00", "こちらにさらなる力を得る\nためのアイテムが眠っている\nようです。主さま、どこから\n挑戦いたしましょう。", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 190801, 28001, "カリン", 28, "2019/09/24 15:00:00", "ようこそ！\n皆さんの素敵な出会いを\nギルド管理協会が\nお手伝いします！", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 190801, 28002, "カリン", 28, "2019/09/24 15:00:00", "ギルド管理協会です\nフレンドに関しては\nこちらでご確認ください", 0.0, 2);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -409.0, 1, "2030/12/17 14:59:59", 190801, 29001, "カリン", 29, "2019/09/24 15:00:00", "こちらがフレンドの\n皆さんです\n素敵な関係を\n築いてくださいね！", 0.0, 3);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -409.0, 1, "2030/12/17 14:59:59", 190801, 29002, "カリン", 29, "2019/09/24 15:00:00", "こちらの一覧で\nフレンドのプロフィールを\n確認できますよ", 0.0, 4);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -409.0, 1, "2030/12/17 14:59:59", 190801, 30001, "カリン", 30, "2019/09/24 15:00:00", "フレンド管理は\nこちらになります\n新しいフレンドとの出会いを\n楽しんでくださいね！", 0.0, 5);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -409.0, 1, "2030/12/17 14:59:59", 190801, 30002, "カリン", 30, "2019/09/24 15:00:00", "フレンドの申請や\n承認ができますよ\nどうぞ、良き交流を！", 0.0, 6);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -409.0, 1, "2030/12/17 14:59:59", 190801, 31001, "カリン", 31, "2019/10/31 12:00:00", "バトルをして力比べを\nしてみましょう！\n実力が試されますね、\n頑張ってください！", 0.0, 7);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -409.0, 1, "2030/12/17 14:59:59", 190801, 31002, "カリン", 31, "2019/10/31 12:00:00", "気になるパーティと\nバトルをしてみましょう！\nどちらが勝利するのか、\n私も楽しみにしていますね", 0.0, 8);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -409.0, 1, "2020/01/04 4:59:59", 190801, 32001, "カリン", 32, "2019/12/20 5:00:00", "ルーキーの皆さんのために\n特別なミッションを\nご用意いたしました！\nぜひ、挑戦してください！", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -409.0, 1, "2020/01/04 4:59:59", 190801, 32002, "カリン", 32, "2019/12/20 5:00:00", "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", 0.0, 2);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -409.0, 1, "2020/01/04 4:59:59", 190801, 33001, "カリン", 33, "2019/12/20 5:00:00", "フレンドになって\n初心者の方を応援しましょう！\n素敵な報酬が待っていますよ！", 0.0, 3);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -409.0, 1, "2020/01/04 4:59:59", 190801, 33002, "カリン", 33, "2019/12/20 5:00:00", "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", 0.0, 4);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -409.0, 1, "2020/01/10 11:59:59", 190801, 34001, "カリン", 34, "2020/01/04 5:00:00", "お疲れ様でした！\nミッションの報酬の受け取りは\nこちらからできますよ！", 0.0, 5);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -409.0, 1, "2020/01/10 11:59:59", 190801, 34002, "カリン", 34, "2020/01/04 5:00:00", "ミッション報酬の受け取りは\nこちら！\n受け取り漏れの無いように\n気を付けてくださいね！", 0.0, 6);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 5.3, 0, 0, -458.0, 2, "2030/12/17 14:59:59", 105801, 38001, "ペコリーヌ", 38, "2015/12/17 15:00:00", "過去のストーリーイベントを\n楽しめちゃいますよ！\n遊んだことのないものがあれば\n一緒にやってみましょう♪", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 6.5, 0, 0, -458.0, 2, "2030/12/17 14:59:59", 105801, 38002, "ペコリーヌ", 38, "2015/12/17 15:00:00", "これまでのイベントで登場した\n限定キャラを仲間にできたり\nメモリーピースが手に入る\nみたいですよ。やばいですね☆", 0.0, 2);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (3, 0.0, 0, 0, 9999.0, 3, "2020/04/08 23:59:59", 105801, 39005, "ペコリーヌ", 39, "2020/04/01", "", 9999.0, 0);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -430.0, 1, "2030/12/17 14:59:59", 190801, 40001, "カリン", 40, "2015/12/17 15:00:00", "これまでに出題された\n問題を振り返ることが\nできますよ\n復習は大切です♪", 0.0, 2);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 2104010, -363.0, 1, "2030/12/17 14:59:59", 106401, 41001, "シェフィ", 41, "2015/12/17 15:00:00", "ここでは腕試しが\nできるんですって。\n自分の実力を測るのに、\nちょうどよさそうね。", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 105801, 41002, "ペコリーヌ", 41, "2015/12/17 15:00:00", "ここで腕試しを\nしていきましょう！\n全力全開、\nがんばっちゃいますよ～！", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 106001, 41003, "キャル", 41, "2015/12/17 15:00:00", "ここで腕試しが\nできるみたいね。\n試してみるのも\nいいんじゃない？", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 105901, 41004, "コッコロ", 41, "2015/12/17 15:00:00", "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -416.5, 1, "2030/12/17 14:59:59", 105901, 42001, "コッコロ", 42, "2015/12/17 15:00:00", "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 2104010, -416.5, 1, "2030/12/17 14:59:59", 106401, 42002, "シェフィ", 42, "2015/12/17 15:00:00", "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -416.5, 1, "2030/12/17 14:59:59", 105801, 42003, "ペコリーヌ", 42, "2015/12/17 15:00:00", "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -416.5, 1, "2030/12/17 14:59:59", 106001, 42004, "キャル", 42, "2015/12/17 15:00:00", "ミッションを達成すると、\n報酬が出るんですって。\n一緒にやってみましょ！", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 105801, 43001, "ペコリーヌ", 43, "2015/12/17 15:00:00", "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 105901, 43002, "コッコロ", 43, "2015/12/17 15:00:00", "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -363.0, 1, "2030/12/17 14:59:59", 106001, 43003, "キャル", 43, "2015/12/17 15:00:00", "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -416.5, 1, "2030/12/17 14:59:59", 123001, 43004, "アメス", 44, "2015/12/17 15:00:00", "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -416.5, 1, "2030/12/17 14:59:59", 123001, 43005, "アメス", 44, "2015/12/17 15:00:00", "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", 0.0, 2);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 5.79, 0, 0, -416.5, 2, "2030/12/17 14:59:59", 123001, 43006, "アメス", 45, "2015/12/17 15:00:00", "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", 0.0, 3);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 0.0, 0, 0, -371.5, 1, "2030/12/17 14:59:59", 123001, 46001, "アメス", 46, "2015/12/17 15:00:00", "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (2, 0.0, 0, 0, -416.5, 2, "2030/12/17 14:59:59", 104901, 47001, "シズル", 47, "2015/12/17 15:00:00", "呼ばれて飛び出てお姉ちゃんだよ♪\nたとえ火の中、水の中、迷宮の中っ\nこのダンジョンを踏破できるよう\n弟くんを応援してあげるからねっ♪", 0.0, 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, 9.32, 0, 0, -416.5, 2, "2030/12/17 14:59:59", 101101, 47002, "リノ", 47, "2015/12/17 15:00:00", "ほんとーに不思議な場所ですね～\nお兄ちゃんが冒険を頑張れるよう\nおまじないをかけてあげますねっ\nフレーフレー、お・兄・ちゃんっ♪", 0.0, 1);
